import React from "react";
import "./ItemInForm.css";

function ItemInForm() {
  return (
    <div className="input-container">
      <label htmlFor="item-name" className="label bill-to-label">
        Item Name
      </label>
      <input
        type="text"
        className="invoice-input bill-to-input date-input"
        name="item-name"
      />
    </div>
  );
}

export default ItemInForm;
